import React from "react";

const Gamble = () => {
  const oneDollar = (playerMoney) => {
    if (playerMoney < 1) {
      return "You are Broke";
    } else {
      return playerMoney + 1 || playerMoney - 1;
    }
  };

  return (
    <div className="gamble">
      <img />
      <div>$1</div>
      <div>$3</div>
      <div>$5</div>
      <div>$10</div>
    </div>
  );
};

export default Gamble;
